import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { signOut } from 'firebase/auth';
import { auth } from '../firebase-config';
import CopyrightText from '../Components/CopyrightText.jsx';

function HomePage() {
  const navigate = useNavigate();

  const handleLogout = () => {
    signOut(auth)
      .then(() => {
        console.log('Déconnexion réussie');
        alert('Déconnexion réussie');
        navigate('/');
      })
      .catch((error) => {
        alert(error.message);
      });
  };

  return (
    <div className="flex flex-col h-screen">
      {/* Navbar */}
      <nav className="bg-gray-800 py-4 px-8 flex justify-between items-center">
        <div className="text-white text-xl">Goblo</div>
        <button className="text-white block sm:hidden">
          <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16m-7 6h7" />
          </svg>
        </button>
        <div className="hidden sm:flex items-center space-x-4">
          <Link to="/enrollment" className="text-white">Enroller</Link>
          <Link to="/encaisser" className="text-white">Encaisser</Link>
          <Link to="/reports" className="text-white">Rapports</Link>
          <Link to="/accounts" className="text-white">Comptes</Link>
          <Link to="/control" className="text-white">Contrôler</Link>
          <Link to="/withdraw" className="text-white">Décaisser</Link>
        </div>
      </nav>

      {/* Logo */}
      <div className="flex justify-center my-8">
        <img className="w-20 h-20" src="/logo.png" alt="Logo de l'application" />
      </div>

      {/* Card grid */}
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4 flex-grow">
        {/* Card 1 */}
        <Link to="/enrollment">
          <div className="bg-gray-200 p-4 rounded-lg flex flex-col items-center justify-center hover:bg-gray-300 transition duration-300">
            <img src="hommes.png" alt="Icône" className="w-12 h-12" />
            <div className="font-semibold text-center mt-2">Enroller</div>
            <div className="text-center">Enregistrer les contribuables</div>
          </div>
        </Link>
        {/* Ajoutez d'autres cartes de la même manière */}
      </div>

      {/* Bouton de déconnexion */}
      <button onClick={handleLogout} className="btn btn-primary self-center">Déconnexion</button>

      {/* Copyright */}
      <div className="text-center mt-auto py-8">
        <CopyrightText />
      </div>
    </div>
  );
}

export default HomePage;
